content:
Então vamos começar a colocar os temas para votar:
1 - Fim do voto obrigatório;
2 - Proibido qualquer tipo de reeleição de cargos eletivos do poder legislativo e executivo em todo território nacional (fim da reeleição até para deputados, senadores e vereadores);
3 - Voto direto a pessoa e não ao partido que faz parte da legenda;
4 - Tempos de televisão idêntica para todos os candidatos (e não pela bancada);
5 - O financiamento de campanha se dará sem aporte de verbas de iniciativa privada;
6 - Não será permitida a troca de candidatos que tenham tido suas candidaturas não aprovadas em período inferior a 45 dias do pleito eleitoral;
7 - A convenção partidária terá que ser realizada até 180 dias antes das eleições, com a entrega da lista e registro dos candidatos até 5 dias após (assim os TREs terão tempo para confirmarem as candidaturas);
8 - Político é funcionário público, portanto se cometer qualquer crime não tem direito a imunidade parlamentar.

A voz do povo diz: 
-menos deputados, menos senadores, menos vereadores, mais policiais, mais professores e mais médicos;
-diminuir os gastos com os deputados, senadores e vereadores e aumentar os salários e qualificar os policiais, professores e médicos, enfim devolver a dignidade para aqueles que verdadeiramente prestam serviços a população porque se professor for bom e interessado, ele ensina embaixo de um pé de manga, se o médico for competente e interessado, ele opera com uma faca de cozinha numa garagem e se o policial for digno, ele defende a população com um porrete de madeira;
- investir em educação, saúde e segurança não é investir em obras faraônicas que só servem para pagar comissões e propinas aos políticos. Temos que valorizar o profissional e isso chama-se salário digno;
- Deixe de dar esmolas (bolsas) e dê oportunidades, mesmo porque as suas esmolas saem exatamente do bolso deste um terço que você acabou de dizer que abandou

