São beneficiados pelo foro privilegiado, na Constituição Federal:
No Supremo Tribunal Federal:
Presidente e vice-presidente da República;
Deputados federais;
Senadores;
Ministros de Estado;
Procurador-geral da República;
Comandantes da Marinha do Exército e da Aeronáutica;
Membros do Tribunal de Contas da União;
Membros dos tribunais superiores (STF, STJ, TST, TSE e STM);
Chefes de missão diplomática de caráter permanente.
No Superior Tribunal de Justiça:
Governadores;
Desembargadores dos Tribunais de Justiça;
Membros dos Tribunais de Contas Estaduais;
Membros dos Tribunais Regionais Federais,
dos Tribunais Regionais Eleitorais
e dos Tribunais Regionais do Trabalho;
Membros dos conselhos e Tribunais de Contas dos municípios;
Membros do Ministério Público da União que atuem nos tribunais
No Tribunal de Justiça
Prefeito
Deputado Estadual

Se essas manifestações servirem para uma das coisas abaixo  ou algumas ou todas já cumpriram a função:
1) Todo mundo ir pra rua no dia da eleição e não votar em nenhum desses que estão aí;
2) Fazer com que se acabe com a reeleição em todos os níveis;
3) Fazer com que o ESTADO compra com suas funções, para as quais foi criado: Para oferecer: EDUCAÇÃO, SAÚDE, TRANSPORTES E SEGURANÇA. NO MEU ENTENDIMENTO É SÓ ISSO QUE A SOCIEDADE QUER. Estou vendo tanta gente importante falando bonito e querendo inventar a RODA, mas eu tenho certeza que o povo só que isso.
